import React from 'react';
import { Switch, Route } from 'react-router-dom';
import './App.css';
import HomePage from './pages/homepage/homepage.component';

const HatsPage = () => {
  return (
    <div>
      <h1>HATS!</h1>
    </div>
  );
};

function App() {
  return (
    <div>
      <Switch>
        <Route exact to="/" component={HomePage} />
        <Route exact to="/hats" component={HatsPage} />
      </Switch>
    </div>
  );
}

export default App;
